function ParseFrames(): FramesData {
    let framesData: FramesData = [];
    for(let frameBucket = 0; frameBucket < anim_buckets; ++frameBucket){
        let frameKey = "f" + String(frameBucket);
        // mod.DisplayHighlightedWorldLogMessage(mod.Message(mod.stringkeys.debug_animation_pre_parse, frameBucket));
        //let frameStr: string = "!!!!!" + mod.stringkeys["f" + String(frameBucket)];
        let frameStr: string = raw_frame_data.f0;// ["f" + String(frameBucket)];
        // frameStr = frameStr.slice(5);
        //mod.DisplayHighlightedWorldLogMessage(mod.Message(mod.stringkeys.debug_animation_pre_parse, frameStr.length));
        let frameStrSplit:string[] = frameStr.split(String(','));
        // mod.DisplayHighlightedWorldLogMessage(mod.Message(frameStrSplit.length));
        let frameColorRLEdata: number[] = frameStrSplit.map((val:String) => {return Number(val)});
        // mod.DisplayHighlightedWorldLogMessage(mod.Message(mod.stringkeys.debug_anim_finished_parsing_frame, frameColorRLEdata.length));
        framesData = framesData.concat(frameColorRLEdata);
    }
    // mod.DisplayHighlightedWorldLogMessage(mod.Message(mod.stringkeys.debug_animation_parsed, framesData.length));
    return framesData;
}

