// Triggered on main gamemode start/end. Useful for game start setup and cleanup.
export async function OnGameModeStarted() {
    // Enables or disables a headquater. Note that HQ_PlayerSpawner has to be placed in Godot scene, assigned an ObjId and a HQArea(CollisionPolygon3D).
    mod.EnableHQ(mod.GetHQ(1), true);
    mod.EnableHQ(mod.GetHQ(2), true);

    mod.DisplayHighlightedWorldLogMessage(mod.Message(mod.stringkeys.debug_gamemode_start));
    gameStarted = true;
    
    StartAnimationInteractPoint = mod.GetInteractPoint(StartAnimationInteractPointId);
    AnimationParentObj = mod.GetSpatialObject(AnimationParentObjId);
    if(!AnimationParentObj){
        mod.DisplayHighlightedWorldLogMessage(mod.Message(mod.stringkeys.debug_anim_spawn_error));
    }
    AnimationRootPosition = mod.GetObjectPosition(AnimationParentObj);
    AnimationRootRotation = mod.GetObjectRotation(AnimationParentObj);
    mod.DisplayHighlightedWorldLogMessage(mod.Message(mod.stringkeys.debug_anim_spawn_location, mod.XComponentOf(AnimationRootPosition), mod.YComponentOf(AnimationRootPosition), mod.ZComponentOf(AnimationRootPosition)));

    pixelPropsBlack = new Array<mod.SpatialObject>();
    // pixelPropsWhite = new Array<mod.SpatialObject>();
     
    gameStarted = true;

    await mod.Wait(5);
    TickAnimationUpdate();
}

async function TickAnimationUpdate(): Promise<void> {    
    let dataIdx = 0; // Track position in the flat RLE array
    let anim_data: FramesData = [];
    let localPixelProps: mod.SpatialObject[] = [];
    let localPixelStates: number[] = [];

    while (gameStarted) {
        if(animationPlaying){
            if(!propsSpawned){
                // Parse JSON and verify
                anim_data = ParseFrames();
                console.log(`Parsed ${anim_data.length} RLE anim values`);
                // mod.DisplayHighlightedWorldLogMessage(mod.Message(mod.stringkeys.debug_animation_verify_data, anim_data.length));
                await mod.Wait(3);
                localPixelProps = SpawnAnimProps();
                console.log(`Spawned ${localPixelProps.length} pixel props`);

                localPixelStates = new Array(localPixelProps.length).fill(0);
                await mod.Wait(3);
            }

            let frameUpdatePixelsStart = Date.now();

            // mod.DisplayHighlightedWorldLogMessage(mod.Message(mod.stringkeys.debug_anim_starting_frame, currentAnimationFrame));
            let pixelIdx = 0;
            let pixelsPerFrame = anim_width * anim_height;
            // mod.DisplayHighlightedWorldLogMessage(mod.Message(mod.stringkeys.debug_animation_verify_data, anim_data.length));
            
            // Decode RLE data for current frame
            let changedPixels: number[][] = [];
            while (pixelIdx < pixelsPerFrame && dataIdx < anim_data.length - 1) {
                const color = anim_data[dataIdx];      // Color/palette index at even indices
                const count = anim_data[dataIdx + 1];  // Run-length count at odd indices
                const row = Math.floor(pixelIdx / anim_width);
                const col = Math.floor(pixelIdx % anim_width);
                // Set pixels for this RLE run
                for (let j = 0; j < count && pixelIdx < pixelsPerFrame; j++) {
                    // Enable black props when color is 0, disable when color is 1
                    if(color != localPixelStates[pixelIdx] && ((pixelIdx + (row % 2)) % anim_num_interleave_frames == currentAnimationFrame % anim_num_interleave_frames)){
                        changedPixels.push([pixelIdx, color]);
                        localPixelStates[pixelIdx] = color;
                    }
                    pixelIdx += 1;
                }
                
                dataIdx += 2; // Move to next RLE pair (color, count)
            }

            // Only updated changed pixels for speed
            for(let i = 0; i < changedPixels.length; ++i){
                //mod.EnableSpatialObject(localPixelProps[changedPixels[i][0]], changedPixels[i][1] === 0);
                let pixel = localPixelProps[changedPixels[i][0]];
                //mod.RotateObject(pixel, mod.CreateVector(mod.DegreesToRadians(changedPixels[i][1] ? -90 : 90), 0, 0));
                // mod.EnableSpatialObject(pixel, changedPixels[i][1] ? false : true);
                
                if(pixel){
                    // mod.MoveObjectOverTime(
                    //     pixel, 
                    //     mod.CreateVector(0,0,0), 
                    //     mod.CreateVector(mod.DegreesToRadians(changedPixels[i][1] ? -90 : 90), 0, 0),
                    //     playbackRate,
                    //     false,
                    //     false
                    // );
                    mod.RotateObject(pixel, mod.CreateVector(mod.DegreesToRadians(changedPixels[i][1] ? -90 : 90), 0, 0));
                } 
                
            }
            let frameUpdatePixelsEnd = Date.now();
            let timeDelta = frameUpdatePixelsEnd - frameUpdatePixelsStart;
            console.log(`Frame: ${currentAnimationFrame}, Updates: ${changedPixels.length}, Time: ${timeDelta}ms`);

            // Move to next frame (wraps around to 0 after last frame)
            currentAnimationFrame = (currentAnimationFrame + 1) % anim_total_frames;
            
            // If we've shown all frames, reset to beginning of data
            if (currentAnimationFrame === 0) {
                dataIdx = 0;
            }
        }

        // Wait for next frame
        await mod.Wait(playbackRate);
    }
}
